import styled from "styled-components";


export const StyleMapContainer = styled.div `{
	display: flex;
	flex-direction: column;
	padding: 2em;
	width: 100%;
	height: 55%;
	border: 20px;
	box-shadow: 10px 8px 20px 5px rgb(0 0 0 / 50%);



	}
`;
